import React from "react";
import Home from "./pages/Home";
import RecipeList from "./pages/RecipeList";
import RecipeInfo from "./pages/RecipeInfo";
import Contact from "./pages/Contact";
import { BrowserRouter as Router, Route, Link, Routes } 
       from "react-router-dom";

const App = () => {
  return (
    <Router>  
    <div className="App">  
    <Routes>  
      <Link to='/'  element={<Home />}  />
          <Link to='/recipe-voice-bot/' element={<Home />}></Link>  
          <Link to='/recipe-voice-bot/search_recipe' element={<RecipeList />}></Link>  
          <link to ='/recipe-voice-bot/recipe_info' element={<RecipeInfo />}></link>  
          <Link to='/recipe-voice-bot/contact' element={<Contact />}></Link> 
   </Routes>  
   </div>  
</Router>  
  );
};

export default App;
